import React, {useEffect, useState} from 'react'
import {getStudents} from '../services/StudentService' 
import axios from 'axios';

const ListStudentComponent = () => {
    const STUDENT_API_BASE_URL = "http://localhost:8443/students";
    const AuthStr = 'Bearer '.concat("eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiIxOTQ2NDA4NjE2IiwiZXhwIjoxNzI1OTM4NzA1LCJpYXQiOjE3MjU4Nzg3MDV9.fbEXRuNwn9EzxWJ6FGDVLAP5ZXG8gWnpBo_VWjr7AHcoPHaFAiMyRQxY4Up-Ah2ARoUsOFu552QhqesRJ0QUng"); 
    const students = async () => {
        const res = await axios.get(STUDENT_API_BASE_URL, { headers: { Authorization: AuthStr } });
        return res.data;
    };
      console.log('GAGAN' +students)

      const dummyData = [
        {
            "id": 19,
            "name": "GAGAN SHARMA",
            "contactNumber": 8826408616,
            "address": "Dibai",
            "pincode": 201300
        },
        {
            "id": 20,
            "name": "AKANKSHA SHARMA",
            "contactNumber": 8846408616,
            "address": "Dibai",
            "pincode": 201200
        }
    ]

    return (

        <div className='container'>
                 <h2 className="text-center">Student List</h2>
                 <br></br>
                 <div className = "row">
                        <table className = "table table-striped table-bordered">

                            <thead>
                                <tr>
                                    <th> Student Id</th>
                                    <th> Student Name</th>
                                    <th> Student Contact Number</th>
                                    <th> Student Address</th>
                                    <th> Student Pincode</th>
                                </tr>
                            </thead>
                            <tbody>
                                {
                                    dummyData.map(
                                        student => 
                                        <tr key = {student.id}>
                                             <td> {student.id}</td>
                                             <td> { student.name} </td>   
                                             <td> {student.contactNumber}</td>
                                             <td> {student.address}</td>
                                             <td> {student.pincode}</td>
                                        </tr>
                                    )
                                }
                            </tbody>
                        </table>

                 </div>

            </div>


  )
}

export default ListStudentComponent
